%%%为了求解裂隙密度，需要计算模拟露头面与三维裂隙网络相交区域的面积A’。首先利用模拟露头面方程：SA*(x-S1/2)+SB*(y-S2/2)+SC*(z-S3/2)=0，令其与长方体状三维裂隙网络的12条棱相交，可解得12个交点
%%%s=solve('y=0','z=0','SA*(x-S1/2)+SB*(y-S2/2)+SC*(z-S3/2)=0','x,y,z');
%%%s=solve('y=0','z=S3','SA*(x-S1/2)+SB*(y-S2/2)+SC*(z-S3/2)=0','x,y,z');
%%%s=solve('y=S2','z=0','SA*(x-S1/2)+SB*(y-S2/2)+SC*(z-S3/2)=0','x,y,z');
%%%s=solve('y=S2','z=S3','SA*(x-S1/2)+SB*(y-S2/2)+SC*(z-S3/2)=0','x,y,z');

%%%s=solve('x=0','z=0','SA*(x-S1/2)+SB*(y-S2/2)+SC*(z-S3/2)=0','x,y,z');
%%%s=solve('x=0','z=S3','SA*(x-S1/2)+SB*(y-S2/2)+SC*(z-S3/2)=0','x,y,z');
%%%s=solve('x=S1','z=0','SA*(x-S1/2)+SB*(y-S2/2)+SC*(z-S3/2)=0','x,y,z');
%%%s=solve('x=S1','z=S3','SA*(x-S1/2)+SB*(y-S2/2)+SC*(z-S3/2)=0','x,y,z');

%%%s=solve('x=0','y=0','SA*(x-S1/2)+SB*(y-S2/2)+SC*(z-S3/2)=0','x,y,z');
%%%s=solve('x=0','y=S2','SA*(x-S1/2)+SB*(y-S2/2)+SC*(z-S3/2)=0','x,y,z');
%%%s=solve('x=S1','y=0','SA*(x-S1/2)+SB*(y-S2/2)+SC*(z-S3/2)=0','x,y,z');
%%%s=solve('x=S1','y=S2','SA*(x-S1/2)+SB*(y-S2/2)+SC*(z-S3/2)=0','x,y,z');

jd1= (S1*SA + S2*SB + S3*SC)/(2*SA);
jd2= (S1*SA + S2*SB - S3*SC)/(2*SA);
jd3= (S1*SA - S2*SB + S3*SC)/(2*SA);
jd4= -(S2*SB - S1*SA + S3*SC)/(2*SA);

jd5= (S1*SA + S2*SB + S3*SC)/(2*SB);
jd6= (S1*SA + S2*SB - S3*SC)/(2*SB);
jd7= (S2*SB - S1*SA + S3*SC)/(2*SB);
jd8= -(S1*SA - S2*SB + S3*SC)/(2*SB);

jd9= (S1*SA + S2*SB + S3*SC)/(2*SC);
jd10= (S1*SA - S2*SB + S3*SC)/(2*SC);
jd11= (S2*SB - S1*SA + S3*SC)/(2*SC);
jd12= -(S1*SA + S2*SB - S3*SC)/(2*SC);
jdzb=ones(12,3);
jdzb=jdzb.*-1;		%将jdzb初始化为全-1矩阵，是为了后续筛选的方便
if jd1>=0 && jd1<=S1
jdzb(1,:)=[jd1,0,0];
end
if jd2>=0 && jd2<=S1
jdzb(2,:)=[jd2,0,S3];
end
if jd3>=0 && jd3<=S1
jdzb(3,:)=[jd3,S2,0];
end
if jd4>=0 && jd4<=S1
jdzb(4,:)=[jd4,S2,S3];
end
if jd5>=0 && jd5<=S2
jdzb(5,:)=[0,jd5,0];
end
if jd6>=0 && jd6<=S2
jdzb(6,:)=[0,jd6,S3];
end
if jd7>=0 && jd7<=S2
jdzb(7,:)=[S1,jd7,0];
end
if jd8>=0 && jd8<=S2
jdzb(8,:)=[S1,jd8,S3];
end
if jd9>=0 && jd9<=S3
jdzb(9,:)=[0,0,jd9];
end
if jd10>=0 && jd10<=S3
jdzb(10,:)=[0,S2,jd10];
end
if jd11>=0 && jd11<=S3
jdzb(11,:)=[S1,0,jd11];
end
if jd12>=0 && jd12<=S3
jdzb(12,:)=[S1,S2,jd12];
end
k=1;
for i=1:12
if jdzb(i,1)~=-1
jdslct(k,:)=jdzb(i,:);		%jdslct是筛选后的交点坐标的集合
k=k+1;
end
end
%%%%以上得到解出的12个交点的坐标，并按照交点是否在长方体内部进行筛选。下面需设法求相交部分的面积。
TRI=delaunay(jdslct(:,1),jdslct(:,2));	%delaunay是三角剖分的函数，其参数是节点的x、y、z坐标。这里只用了x和y坐标，但是同样可以达到剖分的目的。返回值TRI中的每一行为每一个三角形的三个顶点的标号。如果引入z坐标，剖分出来的是四面体，过于复杂了。
[mm,nn]=size(TRI);
nTi=0;
for Ti=1:mm
nTi=nTi+1;
xyz1=jdslct(TRI(Ti,1),:);
xyz2=jdslct(TRI(Ti,2),:);
xyz3=jdslct(TRI(Ti,3),:);
a=sqrt((xyz1(1)-xyz2(1))^2+(xyz1(2)-xyz2(2))^2+(xyz1(3)-xyz2(3))^2);
b=sqrt((xyz2(1)-xyz3(1))^2+(xyz2(2)-xyz3(2))^2+(xyz2(3)-xyz3(3))^2);
c=sqrt((xyz1(1)-xyz3(1))^2+(xyz1(2)-xyz3(2))^2+(xyz1(3)-xyz3(3))^2);
s=(a+b+c)/2;
pro(nTi)=s*(s-a) *(s-b) *(s-c);	%利用海伦公式
if pro(nTi)<0
pro(nTi)=1e-50;
end
pro2(nTi)=sqrt(pro(nTi));
end
jdarea=sum(pro2);		%jdarea为求出的模拟露头面与三维空间截切部分的最终面积A’

munexpt=jdarea*aa/ara;		%munexpt为mun的理想值，利用我们提出的公式得到。
munmean=mean(mun./[1 2 3]);		%munmean为三种假定裂隙密度下与露头面相交的裂隙条数，折算成密度为5000条时与露头面相交的裂隙条数的平均值。
%Vmunexpt=linspace(munexpt,munexpt,length(mun));	%用于寻找与mun理想值最接近的密度
%munresdnt=(mun-Vmunexpt).^2;	%寻找最接近D(ch2)现场值的D(ch2)
%[munsorted,munrank]=sort(munresdnt,'ascend');
%dnsty=munrank(1)*100;	%得到裂隙条数dnsty，即最优裂隙密度
dnsty=round(5000*munexpt/munmean);	%得到裂隙条数dnsty，即最优裂隙密度
